$_MODULE['<{younitedpay}prestashop>states-form_c9cc8cce247e49bae79f15173ce97354'] = 'Ahorrar';
$_MODULE['<{younitedpay}prestashop>content_a6b7b4d3a4b2583c828f35b62cd6db08'] = '¿Qué es YounitedPay?';
$_MODULE['<{younitedpay}prestashop>content_9c25ff979017ac9106f85c96a467795b'] = 'Younited Pay es una oferta de crédito de Younited. Con Younited Pay, tus clientes pueden pagar sus compras a plazos, con vencimientos que van de 10x a 84x. Esta solución está disponible para cestas de la compra de entre 300 y 50.000 euros. Se te abonará la totalidad del pedido y nosotros nos encargaremos de los pagos pendientes. Nuestros ingresos se basan en los intereses de credito o una comisión por las transacciones que se realizan a través de nuestra solución de pago. No hay costes adicionales. Para más información: ';
$_MODULE['<{younitedpay}prestashop>content_72a2413f00f4e19f48a743d53649df80'] = '¿Cómo funciona YounitedPay?';
$_MODULE['<{younitedpay}prestashop>content_5441ee4b931d5da0a9108b95a8bf9ff4'] = 'Una vez que el cliente haya completado su pedido en tu sitio web y haya seleccionado YounitedPay con la duración que más le convenga, será redirigido a nuestra plataforma. Durante este proceso, se le pedirá que verifique su identidad, conecte su cuenta bancaria y responda a algunas preguntas. Estos pasos permiten que la solución YounitedPay esté estrictamente regulada y ofrezca un crédito responsable, de acuerdo con la legislación.';
$_MODULE['<{younitedpay}prestashop>content_6ec990e7528dc73fecf1c785a281024e'] = '¿Qué información debo añadir a mis Condiciones Generales de Contratación?';
$_MODULE['<{younitedpay}prestashop>content_a7fa405610f0ba3ff6025c54ce78985e'] = 'Para cumplir con la legislación, por favor, añade a tus Condiciones Generales de Contratación:';
$_MODULE['<{younitedpay}prestashop>content_f42ae96c1aacec1ad90b014e90017e82'] = '"[el Vendedor] ofrece a sus clientes el servicio de crédito de Younited para el pago de sus compras y la ejecución de su pago. Esto está condicionado a que el cliente acepte el acuerdo de crédito ofrecido por Younited."';
$_MODULE['<{younitedpay}prestashop>content_803e78e989c97d3369a64423cdbb4aee'] = '"Cualquier rechazo por parte de Younited de otorgar crédito para un pedido puede resultar en la cancelación del pedido."';
$_MODULE['<{younitedpay}prestashop>content_5ce1494677fb4b3aacfab319ededc17c'] = '"Cualquier terminación de los Términos y Condiciones Generales que vinculan al cliente y [el Vendedor] resultará en la terminación del acuerdo de crédito entre Younited y el cliente."';
$_MODULE['<{younitedpay}prestashop>content_7cbcb90cc3123f0009733ceeb666274d'] = '“El importe es pagado a través de un crédito aprobado por Younited S.A., sucursal en España de Younited S.A., con nombre comercial Younited credit y Younited, con sede legal y dirección general en España en Carrer de la Caravel·la la Niña, 12, 08017 Barcelona, con Número de Identificación Fiscal W2500913E, asociada a ASNEF n°A810, registrada en el Registro Mercantil de Barcelona con Tomo 45784, Folio 71, Hoja B-498886, Inscripción 1ª y autorizada por el Banco de España con número 1560, y en el Registro de Intermediarios de Seguro con número 11061268 (www.orias.fr)."';
$_MODULE['<{younitedpay}prestashop>content_a9cdc66a2a9729216a30f61e7efd84c0'] = '¿Cómo muestro YounitedPay en mi página de producto?';
$_MODULE['<{younitedpay}prestashop>content_163bff0712ff057a775808f6afd8262b'] = 'Para optimizar tu tasa de conversión y asegurarse de que tus clientes ven la oferta de YounitedPay, puedes mostrar las ofertas elegibles en tu página de producto. Para ello, activa la función "Mostrar mensualidades" en la sección "Visualización" del módulo. Si la visualización no es óptima, asegúrate de haber descargado la última versión del módulo.';
$_MODULE['<{younitedpay}prestashop>content_7dbe03bd93a14e41672dd903a46dbcbf'] = '¿Cómo se gestionan las devoluciones?';
$_MODULE['<{younitedpay}prestashop>content_9b982daf00b49628d34e88c9bce0ccf8'] = 'Hay dos opciones de devolución: completa y parcial. Esta gestión se puede realizar directamente desde el back office de tu módulo Prestashop.';
